import styled from 'styled-components';
const BUTTON = styled.button`
  border: 1px dotted yellow;
  background: white;
  color: black;
  font-weight: 500;
`

export const Contacts: React.FC = () => {
  return (
    <div>
      Contacts
      <BUTTON />
    </div>
  )
}
export default Contacts;
